package leecode;

import javax.crypto.SecretKey;
import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class FirstUniqueCharacterInString {

    public int firstUniqChar(String s) {
        if (s == null || s.length() == 0) return -1;

        int[] counts = new int[26];
        int[] indexes = new int[26];
        for (int i = 0; i < s.length(); i++) {
            counts[s.charAt(i) - 'a']++;
            indexes[s.charAt(i) - 'a'] = i;
        }
        int result = -1;
        for (int i = 0; i < s.length(); i++)
            if (counts[s.charAt(i) - 'a'] == 1) {
                return indexes[s.charAt(i) - 'a'];
            }
        return result;
    }

    public static void main(String args[]) {
        FirstUniqueCharacterInString f = new FirstUniqueCharacterInString();
        System.out.println(f.firstUniqChar("leetcode"));
        System.out.println(f.firstUniqChar("loveleetcode"));
        System.out.println(f.firstUniqChar("ccc"));
        System.out.println(f.firstUniqChar("dddccdbba"));
        System.out.println(f.firstUniqChar("dbddaadbb"));
        System.out.println(f.firstUniqChar(""));
    }
}
